import React, { useState, useEffect } from 'react';

const List = () => {
    const [state, setState] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/api/issuers')
            .then(response => response.json())
            .then(data => {
                setState(data);
            });
    }, []);

    return (
        <div>
            {state.map(obj => (
                <div key={obj.id}>
                    <p>{obj.symbol}</p>
                    <p>{obj.date}</p>
                    <p>{obj.closePrice}</p>
                    <p>{obj.volume}</p>
                </div>
            ))}
        </div>
    );
};

export default List;
